In Temptation of the Gypsies: Part 2: Ranch Hand Raunch, almost everything, including the cast, changes. Gone are the colorful, silky gypsy costumes, replaced by riding pants boots. The men play the entire production shirtless, and some of the opening footage, of them riding on horseback, their ample pecs glowing in the sun, are breathtaking. So, too, is the sex, from start to finish. The two studs who seem to be in charge of the horse farm are Eric Raymond and Joshua Rogers, and they rule the place with both their barked orders and their stiff dicks. Throughout, a lot of the members of the cast show their proficiency with horsewhips, although they don't use them on each other.



